const { LOGIN, LOGOUT } = require('./types');

const inicioSesion = (param) => {
    return {
        type: LOGIN,
        payload: {
            email: param.email,
            password: param.password
        }
    }
}

const cierreSesion = () => {
    return {
        type: LOGIN,
    }
}


module.exports = {
    inicioSesion,
    cierreSesion,
}
